import axios from 'axios';
import React, { Component } from 'react';

import { localStorageGet, localStorageSet } from '../../../../../../StorageGS';

import './index.scss'

export default class index extends React.Component {
    componentDidMount() {

        // let keyword = '碧蓝航线'
        // if(this.props.location.state.keyword === '') {
        //     keyword = localStorageGet("keyword", this.props.location.state.keyword)
        // }else {
        //     keyword = this.props.location.state.keyword
        // }
        // this.setState({
        //     keyword
        // })
        // axios.get('http://localhost:3001/api/searchresults', { params: {
        //     keyword
        // } })
        // .then( function(response) {
        //     console.log(response)
        // })
        // .catch( function(err) {
        //     console.log(err)
        // })
    }

    render() {
        return (
            <div className="comprehensive">
                <div className="mixin-list">
                    <ul className="game-list">
                        <li className="game-item">
                            <a className="cover-img">
                                <div className="lazy-img">
                                    <img src="https://i0.hdslb.com/bfs/game/f15afdeae1ff7d3e0a045847a5cf4741cfd7c184.png@520w_300h.webp" />
                                </div>
                            </a>
                            <div className="bili-info">
                                <span className="handline cardhead">
                                    <span className="type">游戏</span>
                                    <a className="title">碧蓝航线</a>
                                    <div className="grade-wrap">
                                        <div className="player-grade">
                                            玩家评分:
                                            <span className="grade">9.1</span>
                                            <span className="grade-text">分</span>
                                        </div>
                                    </div>
                                </span>
                                <p className="desc">
                                    平台: Android、ios
                                </p>
                                <p className="desc">
                                    游戏简介：4周年誓约立绘来了哟！
                                </p>
                                <div className="btn-wrap">
                                    <div className="btn-bili primary">下载</div>
                                    <div className="btn-bili default">
                                        评价
                                        <span>(6.1万条)</span>
                                    </div>
                                </div>
                            </div>
                        </li>
                    </ul>
                    <ul className="bangumi-list">
                        <li className="bangumi-item">
                            <div className="bangumi-item-wrap">
                                <a href="#" className="left-img">
                                    <div className="lazy-img">
                                        <img src="	https://i0.hdslb.com/bfs/bangumi/56f5ca7a0efbcf0edd467a481252ca2decb5a3d6.png@180w_240h.webp" alt="" />
                                    </div>
                                    <div className="bangumu-tag"></div>
                                </a>
                                <div className="right-info">
                                    <div className="headline">
                                        <span className="bangumi-label">番剧</span>
                                        <a href="#" className="title">
                                        <em className="keyword">碧蓝</em>
                                        </a>
                                    </div>
                                    <div className="intros">
                                        <div className="line clearfix">
                                            <div className="left-block">
                                                <span className="label">风格:</span>
                                                <span className="value">游戏改/战斗/萌系/架空</span>
                                            </div>
                                            <div className="right-block">
                                                <span className="label">地区:</span>
                                                <span className="value">日本</span>
                                            </div>
                                        </div>
                                        <div className="line clearfix">
                                            <div className="left-block">
                                                <span className="label">开播时间</span>
                                                <span className="value">2019年10月3日</span>
                                            </div>
                                            <div className="right-block"></div>
                                        </div>
                                    </div>
                                    <div className="grid"></div>
                                    <div className="score"></div>
                                </div>
                            </div>
                        </li>
                    </ul>
                    <ul className="user-list"></ul>
                </div>
            </div>
        );
    }
}
